let io=require("socket.io-client");class Manager{static socket=io("https://tetris-panda.herokuapp.com/");static user=null;static init(e){Manager.createUser()}static joinUserToRoom(){Manager.user&&Manager.socket.emit("joinUserToRoomRequest",Manager.user.keyWord)}static getUser(){return Manager.user}static createUser(e){return e?(sessionStorage.setItem("user",JSON.stringify(e)),Manager.user=e,Manager.joinUserToRoom(),!0):!!(e=JSON.parse(sessionStorage.getItem("user")))&&(Manager.user=e,Manager.joinUserToRoom(),!0)}}module.exports=Manager;